'use strict';
/**
 * 阿里云OSS配置
 * 依赖：
 * 1. jquery 1.9.1 +
 * 2. jquery-confirm 3.2.3 : https://craftpip.github.io/jquery-confirm/
 */
var html_lang = html_lang || {};
var PROJECT_NAME = 'quick_fix';
var buildUploadFileName = function (mediaType, uuid, fileName) {
    return [PROJECT_NAME, mediaType, new Date().Format("yyyy/MM/dd"), uuid, fileName].join('/');
};
/** Oss的配置信息 */
var AliOss = (function () {
    var instance = {
        /**
         * UN32 在阿里云 OSS 服务上的2个文件上传/下载地址
         * @type {{public: string, protected: string}}
         */
        urls: {
            // 共有文件地址（不需要签名就可以访问)
            "public": "http://data-pub.un32.com.cn",
            // 受保护的文件地址（需要访问签名）
            "protected": "http://data.un32.com.cn"
        },
        bucket: 'un32-dentallab-public',
        endpoint: 'data-pub.un32.com.cn',
        /**
         * 获取到的upload accessToken
         * 格式：key: id, value: keySecret
         */
        sign: {},

        /**
         * 校验上传文件是否成功。
         * @param url, String - 最终上传的文件的完整URL
         * @return Boolean 如果上传成功返回true，否则返回false
         */
        verifyUploadResult: function (url, func) {
            $.ajax({
                type: 'HEAD',
                async: false,
                headers: {
                    "Access-Control-Allow-Origin": "*"
                },
                url: url,
                success: function () {
                    func(true)
                },
                error: function () {
                    func(false)
                }
            });
        }
    };

    /**
     * 获取阿里云OSS的签名。
     * @param dir
     */
    instance.getUploadtoken = function (dir) {
        var self = this;
        Apis.upload_token.call({
            data: {"baseDir": dir},
            success: function (resp) {
                var ret = $.parseJSON(resp);
                if (ret.success == false) {
                    $.alert({
                        title: html_lang['html.lang.UploadFileFail'],
                        content: html_lang['html.lang.SignatureFailed'] //resp.message
                    });
                    return;
                }

                self.sign = ret.ret;
            },
            error: function (resp) {
                $.alert({
                    title: html_lang['html.lang.UploadFileFail'],
                    content: html_lang['html.lang.SignatureFailed'] + resp.head.message
                });
            }
        });
    };
    return instance;
})();
