/**
 * 进度条封装
 * @param file
 * @param type
 * @return {*|jQuery|HTMLElement}
 */
function unprogressbar(file, type, containerId) {
    this.type = type || "circle";

    var pb;

    if (type == "circle") {
        pb = new ProgressBar.Circle(containerId, {
            strokeWidth: 1,
            easing: 'easeInOut',
            color: '#f08200',
            trailColor: '#eee',
            trailWidth: 1,
            svgStyle: null

        });
    } else if (type == "text") {
        pb = new ProgressBar.Line(containerId, {
            strokeWidth: 0.1,
            easing: 'easeInOut',
            color: '#f08200',
            trailColor: '#fff',
            trailWidth: 1,
            svgStyle: null
        });
    } else {
        pb = new ProgressBar.Line(containerId, {
            strokeWidth: 0.2,
            easing: 'easeInOut',
            color: 'rgba(0,204,102,.2)',
            trailColor: 'rgba(0,0,0,0)',
            trailWidth: 0.2,
            svgStyle: {
                width: 'calc(100% - 1px)',
                height: '32px',
                borderRadius: '30px'
            },
            text: {
                style: {
                    display: 'none',
                }
            }
        });
    }
    pb.set(0);
    pb.updateProgress = function (pct) {
        var step = pct * 0.01;
        pb.set(step);
        pb.setText(Math.ceil(pct) + "%");
    };
    return pb;
}
/**
 * UN32 上传组件
 * 依赖：
 * 1. jquery 1.9.1+
 * 2. plupload v2.3.1
 * 3. ProgressBar 1.0.1 : https://github.com/kimmobrunfeldt/progressbar.js
 * 4. Noty : http://notifyjs.com/ Copyright (c) 2015 MIT
 * 5.  unuploader.js  多语言数据
 *
 * 创建一个上传组件的实例。
 * @param dom_id 上传组件的 HTML 元素ID
 * @param url 后台处理上传的URL
 * @param options Object，选项。可设置的参数：
 *
 * 配置选项：
 *   icon: String, 上传组件的图标，可选值：["default","icon1" ... "icon17"],
 *   color: String or Object, 上传组件图标的颜色，可选值："default" 或者自定义对象: {"fill": "#d0d0d0"},
 *   border: String, 上传组件的边框，可选值："rounded", "default","square"
 *   file_server: String, 后台进行文件处理的服务器类型，可选值：
 *                "normal" 普通，即自己写的文件上传服务器，默认是这个
 *                "ali_oss" 阿里云OSS服务器
 *   upload_dir: String, 文件上传到服务器的哪个路径。只有 file_server 为 ali_oss 的时候才需要。
 *   multi_selection: Boolean , 是否允许一次上传多个文件。
 *   file_type: String[], 文件类型,可选值：
 *                "image": 各种图片文件： jpg,png,gif,bmp,jpeg
 *                "zip": 各种压缩文件：zip, rar,7z
 *                "3d": 各种3d文件：stl,dcm
 *                "txt": 各种文本文件：txt
 *                "document": 各种文档文件：doc,docx,xls,xlsx,pdf,ppt,pptx
 *   max_size: String, 单个文件最大尺寸。如 100mb, 20kb 等
 *   auto_upload: Boolean, 是否自动上传。默认 true
 *   start_upload_btn: String, 开始上传按钮的 dom id
 *   file_list_container: String, 文件列表的 容器 id，如果没有指定，在多个文件上传的时候，不会显示进度条
 *
 * 自定义事件：
 *   post_init: function(unuploader), 自定义在初始化之后要执行的函数
 *   files_added: function(unuploader,files), 当文件被选择之后触发
 *   before_upload: function(unuploader,file), 自定义在文件开始上传之前执行的操作
 *   upload_progress: function(unuploader,file), 自定义事件，处理文件在上传过程中的逻辑
 *   file_uploaded: function(unuploader,file,result), 当单个文件上传完之后调用
 *   upload_complete: function(unuploader,files), 当所有文件上传完之后调用
 *   can_delete: true|false, 上传的文件是否可以删除
 *   on_file_deleted: function(unuploader,files), 当文件删除的时候调用
 *   on_error: function(unuploader,err), 自定义事件，处理出错时的逻辑,
 */
function unuploader(dom_id, url, options) {
    var opt = options || {};
    // 创建对象时传递给对象的参数
    this.options = opt;
    // 浏览 按钮/div
    this.browse_btn = $(dom_id);
    // 上传组件里面的图标
    this.icon = $(unuploader_consts.icons[opt["icon"]] || unuploader_consts.icons.default);
    // 进度条, 格式：key=文件名，value={ui:ProgressBar的UI,bar:ProgressBar对象}
    this.progress_bars = {};
    // 每一个文件所对应的 阿里云oss上传时所需要的签名，只有当 server_type = ali_oss的时候才需要该值
    // 格式：key: file.id , value: 阿里云的oss签名
    this.ali_oss_signatures = {};
    // 文件的上传状态
    // key: 文件ID，value：'NOT_START','UPLOADING','UPLOADED'
    this.file_progress = {};
    // 已经上传成功的文件URLs
    // key: file.id, value: url
    this.uploaded_urls = {};
    // 是否允许多选
    this.allowMultiSelect = opt["multi_selection"] || false;
    // 上传的文件队列
    this.fileQueue = [];
    this.max_size = options["max_size"] || "500m";
    // 上传client
    this.client = null;
    // 上传文件id, 重复上传时使用这个文件id
    this.fileId = options["fileId"] || null;
    // 回调host
    // this.callback_host = options["callback_host"] || un32_vars['application_baseUrl'];
    // 回调Routing
    this.callback_routing = options["callback_routing"] || "";

    var self = this;

    this.getProgressBar = function (file) {
        return this.progress_bars[file.id];
    };

    /**
     * 创建一个简单的进度条
     * @param containerId
     * @param file 正在上传的文件
     * @param options 选项，可设置的参数：
     *      can_delete: 是否显示删除链接。取值：true|false
     *      on_file_deleted: 删除之后的操作，function(unuploader,file)
     */
    this.addLightProgressBar = function (containerId, file, options) {
        var ctn = $(containerId);

        var outter_div = $("<div id='file_div_" + file.id + "'></div>");

        var div_name_and_del = $("<div class='file-list'></div>");

        var progress_div_id = "div_progress_" + file.id;
        var div_progress = $("<div id='" + progress_div_id + "'></div>");
        outter_div.append(div_name_and_del);
        div_name_and_del.append(div_progress);
        ctn.append(outter_div);

        var pb = self.createProgressBar(file, "line", "#" + progress_div_id);
    };

    /**
     * 创建进度条
     * @param file 被上传的文件
     * @param type: 进度条类型, 可选值：
     *              text - 文本进度条
     *              circle - 圆形
     *              line - 条状
     * @return {*}
     */
    this.createProgressBar = function (file, type, containerId) {
        var pb = new unprogressbar(file, type, containerId);
        self.progress_bars[file.id] = pb;
        return pb;
    };

    /**
     * 上传成功之后更新隐藏与的值 追加地址
     *
     */
    this.appendUrlToHiddenFiled = function (uploader, file, hiddenInput) {
        var file_url = uploader.uploaded_urls[file.id];
        // 追加文件路径
        var urls = $(hiddenInput).val();
        var urlArray = urls.split(",");
        var isIn = false;
        for (var url in urlArray) {
            if (url == file_url) {
                isIn = true;
            }
        }
        if (urls == "") {
            $(hiddenInput).val(file_url);
        } else if (!isIn) {
            $(hiddenInput).val(file_url + "," + urls);
        }
    };

    /**
     * 删除之后更新隐藏与的值 移除地址
     *
     */
    this.removeUrlFromHiddenFiled = function (uploader, file, hiddenInput) {
        var file_url = uploader.uploaded_urls[file.id];

        var urls = $(hiddenInput).val();
        var urlsNew = urls.split(',').filter(function (it) {
            return it != file_url
        }).join();

        $(hiddenInput).val(urlsNew);
    };

    // 如果有设置 "start_upload_btn" ，则绑定点击事件
    var start_upload_btn_id = opt["start_upload_btn"] || "";
    if (start_upload_btn_id != '') {
        $(start_upload_btn_id).click(function () {
            startUpload();
        });
    }

    // 后台文件服务器是否为阿里云的oss
    var isAliOss = opt["file_server"] === "ali_oss";
    this.media_type = opt["media_type"] || "order_attachment";
    // 如果 file_server 是阿里oss，那么在初始化组件的时候就申请一个签名。
    if (isAliOss)
        AliOss.getUploadtoken();

    // icon 样式
    var icn_css = unuploader_consts.icon_colors[opt["color"]] || unuploader_consts.icon_colors.default;

    // icon
    this.icon.find("path").css(icn_css);

    // init browse button
    var corner = opt["border"] || "default";
    if (corner.trim().length > 0) {
        this.browse_btn.css(unuploader_consts.corners[corner]);
    }

    this.browse_btn.mouseover(function () {
        self.icon.find("path").css({"fill": "#f58220"});
    });
    this.browse_btn.mouseout(function () {
        self.icon.find("path").css(icn_css);
    });

    this.browse_btn.append(this.icon);

    // 上传组件
    var mime_type = [], ft = opt["file_type"] || [];

    $.each(ft, function (index, t) {
        var type = unuploader_consts.file_types[t];
        if ($.isPlainObject(type)) {
            mime_type.push(type);
        }
    });
    this.mime_type = mime_type;


    // TODO fileType, fileSize filter.
    function getSettingMaxSize() {
        var maxSize = self.max_size.toLocaleLowerCase();
        var value = 0;
        if (maxSize.endsWith('kb') || maxSize.endsWith('k')) {
            value = maxSize.replaceAll("kb", "").replaceAll("k", "");
            return value * 1024;
        }
        else if (maxSize.endsWith('mb') || maxSize.endsWith('m')) {
            value = maxSize.replaceAll("mb", "").replaceAll("m", "");
            return value * 1024 * 1024;
        }

        return isNaN(max_size) ? 0 : parseInt(max_size);
    }


    var applyOssTokenDo = function (func) {
        if (self.client === null) {
            if (!AliOss.endpoint) {
                console.log("AliOss.endpoint not set!");
                return;
            }
            if (!AliOss.sign['accessKeyId']) {
                console.log("AliOss.sign['accessKeyId'] not set!");
                return;
            }
            if (!AliOss.sign['accessKeySecret']) {
                console.log("AliOss.sign['accessKeySecret'] not set!");
                return;
            }

            self.client = new OSS.Wrapper({
                endpoint: AliOss.endpoint,
                accessKeyId: AliOss.sign['accessKeyId'],
                accessKeySecret: AliOss.sign['accessKeySecret'],
                cname: true
            });
            self.client.useBucket(AliOss.bucket);
        }

        return func(self.client);
    };


    var getFileById = function (id) {
        var target = null;
        self.fileQueue.forEach(function (it) {
            if (it.id === id) {
                target = it;
            }
        });

        return target
    };

    // 上传进度回调, 显示进度条
    var progress = function (p, checkpoint) {
        if (!checkpoint)
            return;
        return function (done) {
            var file;
            self.fileQueue.forEach(function (it) {
                if (checkpoint.name.indexOf(it.id) >= 0)
                    file = it;
            });
            if (file) {
                // 触发用户额外自定义的 upload_progress 事件
                var upload_progress_callback = options["upload_progress"];
                if ($.type(upload_progress_callback) === "function") {
                    upload_progress_callback(p, file);
                }
                // 使用默认进度条
                else {
                    var pb = self.getProgressBar(file);
                    pb.updateProgress(p * 100.0);

                    self.file_progress[file.id] = "UPLOADING";
                }
            }
            done();
        }
    };

    // 开始上传
    var startUpload = function (file) {
        // before upload event
        // 触发用户额外自定义的 files_added 事件
        var before_upload_callback = options["before_upload"];
        if ($.type(before_upload_callback) === "function") {
            var result = before_upload_callback(self, file);
            if (!result) {
                // 如果返回false 则不上传文件
                stopUpload();
                self.file_progress[file.id] = "CANCEL";
                return;
            }
        }

        self.file_progress[file.id] = "UPLOADING";
        //  进入上传页面 隐藏按钮页面
        if ($('#select-file') && $('#place-order')) {
            $('#select-file').addClass('hidden');
            $('#place-order').removeClass('hidden');
        }
        //DELETE self.uploader.start();

        applyOssTokenDo(function (client) {
            //var key = self.upload_dir + "/" + file.id + "/" + file.name;
            var key = buildUploadFileName(self.media_type, file.id, file.name);

            var uploaderConfig = {
                progress: progress
            };
            // 设置了上传回调参数
            if (self.callback_host && self.callback_routing) {
                var fileUrl = encodeURI(AliOss.urls.public + "/" + key);
                uploaderConfig['headers'] = {
                    'x-oss-callback': Base64.encode(JSON.stringify(
                        {
                            "callbackUrl": self.callback_host + "/" + self.callback_routing,
                            "callbackBody": "fileid=" + file.id + "&fileurl=" + fileUrl + "&filename=" + file.name
                        }
                    ))
                }
            }
            console.log("aliyun oss uploader config:" + JSON.stringify(uploaderConfig));

            // 100k 以下文件用put 方式上传
            if (file.file.size <= 100 * 1024) {
                var reader = new FileReader();
                reader.readAsArrayBuffer(file.file);
                reader.onload = function () {
                    client.put(key, new OSS.Buffer(reader.result), uploaderConfig).then(function (res) {
                        doUploadFinished(client, file, res);
                    });
                }
            }
            else {
                client.multipartUpload(key, file.file, uploaderConfig).then(function (res) {
                    doUploadFinished(client, file, res);
                });
            }

            function doUploadFinished(client, file, res) {
                // 保存已经上传完的文件URL
                self.file_progress[file.id] = "UPLOADED";

                // 更新进度条状态为100%
                var pb = self.getProgressBar(file);
                if (pb)
                    pb.updateProgress(100.0);

                // window.location = result;
                // var fullUrl = res['url'];
                var fullUrl = res.res.requestUrls[0].split('?')[0];
                //var safeName = file.name;

                // 验证成功
                if (fullUrl) {
                    var progress_div_id = "div_progress_" + file.id;
                    $("#" + progress_div_id).find(".progressbar-text").text(html_lang['html.lang.Complete']);

                    self.uploaded_urls[file.id] = fullUrl;
                }
                // 验证失败!
                else {
                    $.alert({
                        title: html_lang['html.lang.UploadFileFail'],
                        content: html_lang['html.lang.UploadFileFailinfo'],
                    });
                    var progress_div_id = "div_progress_" + file.id;
                    $("#" + progress_div_id).find(".progressbar-text").text(html_lang['html.lang.Failure'])
                }

                self.browse_btn.html("");
                self.browse_btn.append(self.icon);

                file.url = fullUrl;
                var file_uploaded_callback = options["file_uploaded"];
                // 触发用户额外自定义的 file_uploaded 事件
                if ($.type(file_uploaded_callback) === "function") {
                    file_uploaded_callback(self, file, result);
                }

                console.log('upload success: %j', res);
                // return listFiles(self.client);
                self.fileQueue.forEach(function (it, index) {
                    // 移除上传完成的文件
                    if (it.id === file.id) {
                        self.fileQueue.splice(index, 1);
                    }
                });

                // 继续上传后面的文件
                if (self.fileQueue.length > 0 && self.fileQueue[0]) {
                    startUpload(self.fileQueue[0])
                }
                // 文件上传完成
                else {
                    $.each(self.fileQueue, function (idx, file) {
                        self.file_progress[file.id] = "UPLOADED";
                    });

                    var upload_complete_callback = options["var upload_complete"];
                    // 触发用户额外自定义的 var upload_complete 事件
                    if ($.type(upload_complete_callback) === "function") {
                        upload_complete_callback(self, self.fileQueue);
                    }
                }
            }
        });
    };

    // 停止上传
    var stopUpload = function () {
        //DELETE self.uploader.stop();
    };

    if (options['multi_selection'] == false)
        $(dom_id).removeAttr('multiple');
    else
        $(dom_id).attr('multiple', 'multiple');
    // bind file selected event.
    $(dom_id).unbind('change');
    $(dom_id).change(function () {
        var files = this.files;
        // 去除文件外的元素
        for (var f in files) {
            var ff = files[f];
            if (ff && ff.name && typeof ff === 'object') {
                // 文件格式是否对?
                var fileType = ff.name.substring(ff.name.lastIndexOf(".") + 1);
                var existSuffix = self.mime_type.some(function (it) {
                    return it.extensions.indexOf(fileType) >= 0
                });
                if (self.mime_type.length > 0 && !existSuffix) {
                    $.alert(" " + ff.name.split(".")[1] + "格式文件不允许上传,允许的文件格式: stl, zip, rar");
                    continue;
                }

                // 是否超出大小
                if (self.max_size && ff.size > getSettingMaxSize()) {
                    $.alert(" " + ff.name + "文件太大,请上传500M以下的文件");
                    continue;
                }

                self.fileQueue.push({
                    id: self.fileId || UUID.generate(),
                    name: ff.name.replace(/[\\\!\$\^\*\(\)\-\=\+\[\]\{\}\|\:\/\<\>\?,`'~@#%&;\" ]/g, ""),
                    url: '',
                    file: ff
                })
            }
        }

        files = self.fileQueue;
        $.each(files, function (idx, file) {
            self.file_progress[file.id] = "NOT_START";
        });

        var fileListContainer = opt['file_list_container'] || "";
        // 若没定义自定义进度条
        if (!options["upload_progress"]) {
            // 如果不允许上传多个文件，则直接在 browse_btn 内部显示进度条
            if (fileListContainer != "") {
                $.each(files, function (idx, file) {
                    var lightOpt = {
                        "can_delete": opt["can_delete"] || "true",
                        "on_file_deleted": opt["on_file_deleted"] || function () {
                        }
                    };
                    self.addLightProgressBar(fileListContainer, file, lightOpt);
                });
            } else {
                if (!self.allowMultiSelect) {
                    self.browse_btn.empty();
                    var bar = self.createProgressBar(files[0], "circle", dom_id);
                    // $(dom_id).append(bar);
                } else {
                    console.info(html_lang['html.lang.UploadNotAttr']);
                }
            }
        }

        // 触发用户额外自定义的 files_added 事件
        var files_added_callback = options["files_added"];
        if ($.type(files_added_callback) === "function") {
            files_added_callback(self, files);
        }

        // 开始上传第一个文件
        if (self.fileQueue.length > 0 && self.fileQueue[0]) {
            startUpload(self.fileQueue[0])
        }
    });


}



